import React, {FC} from 'react';
import './MyInput.css';

interface myInputProps {
    type: string
    title: string
    placeholder: string
}

const MyInput:FC<myInputProps> = ({title, type, placeholder}) => {
    return (
        <div className={'input__container'}>
            <span>{title}</span>
            <input type={type} placeholder={placeholder}/>
        </div>
    );
};

export default MyInput;
